CREATE TABLE Venues(
   Venue_Id        INTEGER  NOT NULL PRIMARY KEY 
  ,Venue           VARCHAR(47) NOT NULL
  ,Venue_Latitude  NUMERIC(18,15) NOT NULL
  ,Venue_Longitude NUMERIC(21,17) NOT NULL
  ,Venue_Category  VARCHAR(31) NOT NULL
  ,Likes           INTEGER  NOT NULL
  ,Cost            INTEGER  NOT NULL
  ,Neighbourhood   VARCHAR(15) NOT NULL
);
